 import axios from "axios";
import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { useParams } from 'react-router-dom';
const YaziListesi = () => {
  const params = useParams();
  const a = setYaziListesi.find(a => a.id === parseInt(params.id));
    const [yaziListesi, setYaziListesi] = useState({a});
    useEffect(() => {
        axios.get('https://react-yazi-yorum.herokuapp.com/posts')
            .then((response) => {
                setYaziListesi(response.data);

            });
    }, []);

    return (
        <div className="ui relaxed divided list">

          {yaziListesi.map((yazi) => {
            return (
              <div className="item" key={yazi.id}>
                <i className="large github middle aligned icon"></i>
                <div className="content">
                  <Link to={`/posts/${yazi.id}`} className="header">
                    {yazi.title}
                  </Link>
                  <div className="description">{yazi.created_at}</div>
                </div>
              </div>
            );
          })}
        </div>
      );
    };

    export default YaziListesi;
